import { Typography } from "@material-ui/core";
import * as React from "react"
import './main.css';
import responsive from './responsive.png';
import iterative from './iterative.png';
import development from './development3.png';
import hashtags from './hashtags.png';

const pieces = [
    {
        name: "Responsive Redesign",
        image: responsive,
    },
    {
        name: "Iterative Design",
        image: iterative,
    },
    {
        name: "Development",
        image: development,
    },
    {
        name: "Hashtag Activism",
        image: hashtags,
    },
]


const Home = () => {
    return (
        <div className="main">
            <Typography className="intro-text" variant='h2'>Hi there, my name is Tiffany.</Typography>
            <Typography className="intro-text-sub" variant='h5'><p>I'm a senior at Brown university mainly working in AI/Machine Learning and Data Science </p>
            <p>... but currently learning UI/UX design.</p></Typography>
            <div className="pieces">
                {pieces.map(piece => 
                    <div className="project" style={{ backgroundImage:`url(${piece.image})` }}>
                        <div className="project-background">
                            <Typography className="project-text">{piece.name}</Typography>
                        </div>
                        {/* <img className="project-image" src={piece.image}/> */}

                    </div>
                )}
            </div>
        </div>
    );
}

export default Home;
